import React from 'react';
import bullshit from "../images/turtle.svg";

const Home = () => {
    return (
        <div>
            <ul>
                <li>
                    <img src={bullshit} alt="" className='bullshitimage' />
                </li>
                <li>
                    <h2>Opiniile sunt mai importante ca niciodata. Platformele de sondaje permit organizatorilor sa culeaga feedback direct de la audienta lor ca sa inteleaga mai bine nevoile si dorintele lor.</h2 >
                </li>
            </ul>
        </div>
    );
};

export default Home;
